{"id": "49235", "title": "Bug 49235 - ServletContainerInitializer onStartup(Set<Class<? classSet is not expected class", "description": "Bug 49235 - ServletContainerInitializer onStartup(Set<Class<? The output is "MySomeClass".", "OB": "The current output is "MySomeAnn", but I expect the output to be "MySomeClass". This issue seems to be related to the Servlet 3.0 specification. It is worth noting that my code works fine on Glassfish 3.0.", "EB": "", "SR": "I built Tomcat 7.0.0 from svn r939221. Here is my code:

@MySomeAnn
public class MySomeClass{
    ...
}

@HandlesTypes(MySomeAnn.class)
public class ModuleInitializer implements ServletContainerInitializer{
    @Override
    public void onStartup(Set<Class<?>> classSet, ServletContext ctx) throws ServletException{
        for (Class<?> targetClass : classSet){
            System.out.println(targetClass.getName());
        }
    }

Here the current output is "MySomeAnn"."}
